def find_primes(min_num, max_num):
    """"""

    def is_prime(num):
        """Checks if a number is prime."""
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    return [num for num in range(min_num, max_num + 1) if is_prime(num)]
